import './App.css';
import { BrowserRouter as Router,Routes,Route } from "react-router-dom";
import Register from './Register';
import Login from './Login';
// import Regi
function App() {
  return (
    // <div className="App">
      <Router>
        <Routes>
            <Route path='/' element={<Register/>}></Route>
            <Route path='/login' element={<Login/>}></Route>
        </Routes>
      </Router>
    // </div>
  );
}

export default App;
